//import {List} from 'antd';

// need to add items
class WeatherFeed extends React.Component {
    render() {

        const componentDidMount = () => {
            const weatherURL = "http://api.openweathermap.org/data/2.5/forecast/daily?q=London&mode=xml&units=metric&cnt=7&APPID=bc2888013d5044448dbead76c8b69c18"

            fetch(weatherURL)
                .then(res => res.json())
                .then(data => console.log("Data List Loaded", data.List))
        }


        return (
            <div>
                <p>Hi</p>
            </div>
        );
    }
}

export default WeatherFeed;
